import React from "react";
import MealsListItems from "./components/Meals/MealsListItems";

function App() {
  const meals = {
    menuItemName: "sushi",
    menuItemDetails: "yummy sushi",
    price: 22.99,
  };
  return (
    <div>
      <h2>Let's get started!</h2>
      <MealsListItems meals={meals} />
    </div>
  );
}

export default App;
